async function main() {
    const [singer] = await ethers.getSigners();
    console.log("Deploying contracts with the account:", singer.address);
    // We get the contract to deploy
    const {vtradingToken} = await hre.ignition.deploy(VtradingTokenModel, {
        parameters: {
            VtradingToken: {
                initialOwner: singer.address
            }
        }
    });
    const vtradingTokenAddress = await vtradingToken.getAddress();
    const vtradingTokenContract = await ethers.getContractAt("VtradingToken", vtradingTokenAddress);
    console.log("vtradingToken deployed to:", vtradingTokenAddress);

    // await queryVestingSchedules(vtradingTokenContract, "ecosystem");
    ecosystem.recipient = singer.address;

    await setVestingSchedule(vtradingTokenContract, "ecosystem", ecosystem);
    await setVestingSchedule(vtradingTokenContract, "team", team);
    await setVestingSchedule(vtradingTokenContract, "reserve", reserve);
    await setVestingSchedule(vtradingTokenContract, "marketing", marketing);
    await setVestingSchedule(vtradingTokenContract, "foundation", foundation);

    await claimVestedTokens(vtradingTokenContract, "ecosystem");
    const ecosystemSchedule = await queryVestingSchedules(vtradingTokenContract, "ecosystem");
    const teamSchedule = await queryVestingSchedules(vtradingTokenContract, "team");
    const reserveSchedule = await queryVestingSchedules(vtradingTokenContract, "reserve");
    const marketingSchedule = await queryVestingSchedules(vtradingTokenContract, "marketing");
    const foundationSchedule = await queryVestingSchedules(vtradingTokenContract, "foundation");

    let total = ecosystemSchedule.totalAllocated+teamSchedule.totalAllocated+reserveSchedule.totalAllocated+marketingSchedule.totalAllocated+foundationSchedule.totalAllocated;
    console.log("totalAllocated:", total);



}

async function queryVestingSchedules(vtradingTokenContract: VtradingToken, vestingName: string) {
    const vestingSchedule = await vtradingTokenContract.queryVestingSchedule(vestingName);
    // console.log("vestingSchedule:", vestingSchedule);
    return vestingSchedule;
}

async function setVestingSchedule(vtradingTokenContract: VtradingToken, vestingName: string, vestingSchedule: VtradingToken.VestingScheduleStruct) {
    const tx = await vtradingTokenContract.setVestingSchedule(vestingName, vestingSchedule);
    await tx.wait();
    console.log("setVestingSchedule tx:", tx.hash);
}

async function claimVestedTokens(vtradingTokenContract: VtradingToken, vestingName: string) {
    const tx = await vtradingTokenContract.claimVestedTokens(vestingName);
    await tx.wait();
    console.log("claimVestedTokens tx:", tx.hash);
}


main().catch(console.error)



